import React from 'react';
import ProjectSummary from './ProjectSummary';
import {Link} from './'

const Projectlist = ({ projects }) => {
    return (
        <div className='project-list section'>
            {projects && projects.map(project => {
                return (
                    <Link></Link>
                )
            })}
        </div>
    )
}
export default Projectlist
